{{Experiment |Title=CO2 enrichment (FACE) |Contact=Melissa Dawes, Christian Rixen, Frank Hagedorn |Email=melissa.dawes@slf.ch, rixen@slf.ch, frank.hagedorn@wsl.ch |Deployment Name=Stillberg }} =Stillberg CO2 enrichment and soil warming study= ==Overview== High elevation ecosystems are important in research about environmental change because shifts in climate associated with anthropogenic greenhouse gas emissions are predicted to be more pronounced in these areas than in most other regions of the world. This project involves a Free Air CO<sub>2</sub> Enrichment (FACE) and soil warming experiment located in a natural treeline environment near Davos, Switzerland (Stillberg, 2200 m a.s.l.). Elevated atmospheric CO<sub>2</sub> concentrations (+200 ppm) were applied from 2001 to 2009, and a soil warming treatment (+4 K) was added in 2007 (ongoing). The combined CO<sub>2</sub> enrichment and warming treatment reflects conditions expected to occur in this region in approximately 2050. A broad range of ecological and biogeochemical research is carried out as part of this environmental change project. ==Experimental Setup== The experiment consists of 40 hexagonal 1.1 m<sup>2</sup> plots, 20 with a ''Pinus mugo'' ssp. ''uncinata'' (mountain pine, evergreen) individual in the centre and 20 with a ''Larix decidua'' (European larch, deciduous) individual in the centre. A dense cover of understorey vegetation surrounds the tree in each plot, including the dominant dwarf shrub species ''Vaccinium myrtillus'' (bilberry), ''Vaccinium gaultherioides'' (group ''V. uliginosum'' agg., northern bilberry) and ''Empetrum nigrum'' ssp. ''hermaphroditum'' (crowberry) plus several herbaceous and non-vascular species.
[[File:Stillberg CO2expt design.png|thumb]] At the beginning of the experimental period, the 40 plots were assigned to 10 groups of four neighbouring plots (two larch and two pine trees per group) in order to facilitate the logistics of CO<sub>2</sub> distribution and regulation. Half of these groups were randomly assigned to an elevated CO<sub>2</sub> treatment while the remaining groups served as controls and received no additional CO<sub>2</sub>. In spring 2007, one plot of each tree species identity was randomly selected from each of the 10 CO<sub>2</sub> treatment groups and assigned a soil warming treatment, yielding a balanced design with a replication of five individual plots for each combination of CO<sub>2</sub> level, warming treatment and tree species.
==Data== Soil and air conditions have been monitored closely throughout the study period, with most measurements made during the combined CO<sub>2</sub> x warming experiment (2007-2009). These time-series data have been integrated into GSN and the SwissEx wiki site. Manually sampled measurements of other parameters (e.g. plant growth) will be added soon.
